import React from 'react'
import NavBar from '../Components/NavBar'

export default function Home() {
  return (
    <div>
      <NavBar/>
      <div>
        <div><h2>What is Dropbox?</h2>
        <p>Dropbox is a home for all your work. You can </p><p>store and share files, collaborate on projects, </p><p>and bring your best ideas to life—whether </p><p>you’re working alone or as part of a team.</p>
        </div>
      </div>
    </div>
  );
}
